import React from "react";
import styled from "styled-components";
import { SmallSubtitle, FatTitle } from "../styled/typos";
const member = props => {
  const { dataMember } = props;

  return (
    <Container>
      <SmallSubtitle>{dataMember.subTitle}</SmallSubtitle>
      <FatTitle>{dataMember.name}</FatTitle>
    </Container>
  );
};

export default member;

const Container = styled.div`
  position: relative;
`;
